pragma solidity ^0.8.9;

contract Funcles is ERC721, IERC2981, Ownable, ReentrancyGuard {
    using Address for address;
    using Strings for uint256;

    uint256 public MaxFunclesPerAddress = 4;
    uint256 public constant FUNLIST_LIMIT = 2;
    uint256 public constant PRICE = 0.085 ether;

    uint256 public FUNCLES_VAULT = 60;
    uint256 public maxSupply = 3333;
    uint256 public supply = 0;
    string public baseExtension = ".json";
    uint256 private royaltyDivisor = 20;

    mapping(address => uint256) private _funclesByAddressFunlist;
    bytes32 public whitelistMerkleRoot = 0x89b051474330d6eda3afac4fd427a8a43875ca83d44233ad4ac3fa8bc93d9365;

    string public baseURI =
        "https://funcles.mypinata.cloud/ipfs/QmSN76VT7LGMA4fZWmn9NPpuRDC7xfRmLMm9NQP2RPa85S/";
    bool public FunclesToVault = false;
    address vaultAddress = 0x66Aa2272019fb0ce4BCcb5b82f0469Ee9e97242f;
    Status public mintstatus = Status.paused;

    enum Status {
        paused,
        funlist,
        funsale
    }

    constructor(
        uint256 _maxSupply,
        uint256 _FUNCLES_VAULT
        ) ERC721("Funcles", "FUNCLES") {
        maxSupply = _maxSupply;
        FUNCLES_VAULT = _FUNCLES_VAULT;
    }

    /// @dev Returns an URI for a given token ID
    function _baseURI() internal view override returns (string memory) {
        return baseURI;
    }

    function reservedFuncles() public onlyOwner {
        require(!FunclesToVault, "Once only transfer of reserved funcles");

        for (uint256 i = 1; i < FUNCLES_VAULT; i++) {
            _safeMint(vaultAddress, supply + i);
        }

        FUNCLES_VAULT += supply;
        FunclesToVault = false;
    }

    function mint(uint256 numberOfFuncles) public payable {
        require(mintstatus == Status.funsale, "the contract is paused or only funlist sale");

        require(
            numberOfFuncles <= FUNLIST_LIMIT,
            "max mint amount per session exceeded"
        );
        require(supply + numberOfFuncles <= maxSupply, "max NFT limit exceeded");
        require(_funclesByAddressFunlist[msg.sender] + numberOfFuncles <= MaxFunclesPerAddress);
        if (msg.sender != owner()) {
            require(msg.value >= PRICE * numberOfFuncles, "insufficient funds");
        }

        for (uint256 i = 1; i <= maxSupply; i++) {
            _funclesByAddressFunlist[msg.sender]++;
            _safeMint(msg.sender, supply + i);
        }
    }
     modifier isValidMerkleProof(bytes32[] calldata merkleProof, bytes32 root) {
        require(
            MerkleProof.verify(
                merkleProof,
                root,
                keccak256(abi.encodePacked(msg.sender))
            ),
            "Address does not exist in list"
        );
        _;
    }
        modifier isCorrectPayment(uint256 price, uint256 numberOfTokens) {
        require(
            price * numberOfTokens == msg.value,
            "Incorrect ETH value sent"
        );
        _;
    }


    function mintWhitelist(bytes32[] calldata merkleProof, uint256 numberOfFuncles)
        public
        payable
        isValidMerkleProof(merkleProof, whitelistMerkleRoot)
        isCorrectPayment(PRICE, numberOfFuncles)
    {
        require(mintstatus == Status.funlist);
        require(numberOfFuncles < 3);
        require(PRICE * numberOfFuncles >= msg.value);
        require(supply + numberOfFuncles <= maxSupply, "max NFT limit exceeded");
        for (uint256 i = 1; i <= maxSupply; i++) {
            _funclesByAddressFunlist[msg.sender]++;
            _safeMint(msg.sender, supply + i);
        }
    }

    function setWhitelistMerkleRoot(bytes32 merkleRoot) external onlyOwner {
        whitelistMerkleRoot = merkleRoot;
    }

    function pausefunclesvault(bool _state) public onlyOwner {
        FunclesToVault = _state;
    }

    function setStatus(uint8 _status) external onlyOwner {
        mintstatus = Status(_status);
    }

    function setOwner(address _owner) external onlyOwner {
        transferOwnership(_owner);
    }

    function setRoyaltyDivisor(uint256 _divisor) external onlyOwner {
        royaltyDivisor = _divisor;
    }

    modifier onlyExternal() {
        require(msg.sender == tx.origin, "Contracts not allowed to mint");
        _;
    }

    function tokenURI(uint256 tokenId)
    public
    view
    virtual
    override
    returns (string memory) {
        require(_exists(tokenId),"ERC721Metadata: URI query for nonexistent token");
        string memory currentBaseURI = _baseURI();
        return bytes(currentBaseURI).length > 0
        ? string(abi.encodePacked(currentBaseURI, tokenId, baseExtension))
        : "";
    }

    function setBaseURI(string memory _newBaseURI) public onlyOwner {
        baseURI = _newBaseURI;
    }

    function royaltyInfo(uint256 tokenId, uint256 Price)
    external
    view
    override
    returns (address receiver, uint256 royaltyAmount) {
        require(_exists(tokenId), "Nonexistent token");
        return (address(this), Price / royaltyAmount);
    }

    // withdrawal function for ownlyOwner to transfer funds in wallet
    function withdraw() public onlyOwner {
        uint balance = address(this).balance;
        payable(msg.sender).transfer(balance);
    }
}

